import React from "react";
import MissionHeader from "./MissionHeader";
import MissionList from "./MissionList";
import Card from "../UI/Card";

const ShiftSummary = (props) => {
  return (
    <div className="grid auto-rows-min w-full">
      <div className="pb-3 sm:pb-2">
        <h1 className="text-lg font-medium leading-6 text-gray-900 ">
          Shift summary
        </h1>
      </div>
      <Card className="">
        <MissionHeader shiftInformationHandler={props.shiftInformationHandler}/>
        {props.missionList.length > 0 && (
          <MissionList missionList={props.missionList} deleteHandler={props.deleteHandler}></MissionList>
        )}
      </Card>
    </div>
  );
};
export default ShiftSummary;
